Double Agent: The Eddie Chapman Story

History Documentary hosted by Ben Macintyre, published by BBC broadcasted as part of BBC Timewatch series in 2011 - English narration


Information
------------------------------

Ben Macintyre reveals the gripping true story of Britain's most extraordinary wartime double agent, Eddie Chapman. A notorious safe-breaker before the war, Chapman duped the Germans so successfully that he was awarded their highest decoration, the Iron Cross. He remains the only British citizen ever to win one. Including remarkable and newly discovered footage from an interview Chapman gave three years before his death in 1997, the programme goes on the trail of one of Britain's most unlikely heroes - a story of adventure, love, intrigue and astonishing courage.

